        "OBUNCOUS": "Hooked or crooked in an extreme degree. Maunder.",
        "OBVENTION": "The act of happening incidentally; that which happens casually;an incidental advantage; an occasional offering. [Obs.] \"Tithes andother obventions.\" Spenser.Legacies bequeathed by the deaths of princes and great persons, andother casualities and obventions. Fuller.",
        "OBVERSANT": "Conversant; familiar. [Obs.] Bacon.",
        "OBVERSE": "Having the base, or end next the attachment, narrower than thetop, as a leaf.",
        "OBVERSELY": "In an obverse manner.",
        "OBVERSION": "The act of immediate inference, by which we deny the oppositeof anything which has been affirmed; as, all men are mortal; then, byobversion, no men are immortal. This is also described as \"immediateinference by privative conception.\" Bain.",
        "OBVERT": "To turn toward.If its base be obverted towards us. I. Watts.",
        "OBVIATION": "The act of obviating, or the state of being obviated.",
        "OBVIOUS": "Overlapping; contorted; convolute; -- applied primarily, inbotany, to two opposite leaves, each of which has one edgeoverlapping the nearest edge of the other, and secondarily to acircle of several leaves or petals which thus overlap.",
        "OBY": "See Obi.",
        "OCA": "A Peruvian name for certain species of Oxalis (O. crenata, andO. tuberosa) which bear edible tubers.",
        "OCARINA": "A kind of small simple wind instrument.",
        "OCCAMY": "An alloy imitating gold or silver. [Written also ochimy,ochymy, etc.]",
        "OCCASION": "To give occasion to; to cause; to produce; to induce; as, tooccasion anxiety. South.If we inquire what it is that occasions men to make severalcombinations of simple ideas into distinct modes. Locke.",
        "OCCASIONABLE": "Capable of being occasioned or caused. Barrow.",
        "OCCASIONALISM": "The system of occasional causes; -- a name given to certaintheories of the Cartesian school of philosophers, as to theintervention of the First Cause, by which they account for theapparent reciprocal action of the soul and the body.",
        "OCCASIONALITY": "Quality or state of being occasional; occasional occurrence.[R.]",
        "OCCASIONALLY": "In an occasional manner; on occasion; at times, as conveniencerequires or opportunity offers; not regularly. Stewart.The one, Wolsey, directly his subject by birth; the other, hissubject occasionally by his preferment. Fuller.",
        "OCCASIONATE": "To occasion. [Obs.]The lowest may occasionate much ill. Dr. H. More.",
        "OCCASIONER": "One who, or that which, occasions, causes, or produces. Bp.Sanderson.",
        "OCCASIVE": "Of or pertaining to the setting sun; falling; descending;western.",
        "OCCECATION": "The act of making blind, or the state of being blind. [R.]\"This inward occecation.\" Bp. Hall.",
        "OCCIDENT": "The part of the horizon where the sun last appears in theevening; that part of the earth towards the sunset; the west; --opposed to orient. Specifically, in former times, Europe as opposedto Asia; now, also, the Western hemisphere. Chaucer.I may wander from east to occident. Shak.",
        "OCCIDENTALS": "Western Christians of the Latin rite. See Orientals. Shipley.",
        "OCCIDUOUS": "Western; occidental. [R.] Blount.",
        "OCCIPITAL": "Of or pertaining to the occiput, or back part of the head, orto the occipital bone. Occipital bone (Anat.), the bone which formsthe posterior segment of the skull and surrounds the great foramen bywhich the spinal cord leaves the cranium. In the higher vertebratesit is usually composed of four bones, which become consolidated inthe adult.-- Occipital point (Anat.), the point of the occiput in the mesialplane farthest from the ophryon.",
        "OCCIPITO-": "A combining form denoting relation to, or situation near, theocciput; as, occipito-axial; occipito-mastoid.",
        "OCCIPITOAXIAL": "Of or pertaining to the occipital bone and second vertebra, oraxis.",
        "OCCIPUT": "The back, or posterior, part of the head or skull; the regionof the occipital bone.",
        "OCCISION": "A killing; the act of killing. [Obs.] Sir M. Hale.",
        "OCCLUDE": "To take in and retain; to absorb; -- said especially withrespect to gases; as iron, platinum, and palladium occlude largevolumes of hydrogen.",
        "OCCLUDENT": "Serving to close; shutting up.-- n.",
        "OCCLUSE": "Shut; closed. [Obs.] Holder.",
        "OCCLUSION": "The transient approximation of the edges of a natural opening;imperforation. Dunglison. Occlusion of gases (Chem. & Physics), thephenomenon of absorbing gases, as exhibited by platinum, palladium,iron, or charcoal; thus, palladium absorbs, or occludes, nearly athousand times its own volume of hydrogen, and in this case achemical compound seems to be formed.",
        "OCCRUSTATE": "To incrust; to harden. [Obs.] Dr. H. More.",
        "OCCULT": "Hidden from the eye or the understanding; inviable; secret;concealed; unknown.It is of an occult kind, and is so insensible in its advances as toescape observation. I. Taylor.Occult line (Geom.), a line drawn as a part of the construction of afigure or problem, but not to appear in the finished plan.-- Occult qualities, those qualities whose effects only wereobserved, but the nature and relations of whose productive agencieswere undetermined; -- so called by the schoolmen.-- Occult sciences, those sciences of the Middle Ages which relatedto the supposed action or influence of occult qualities, orsupernatural powers, as alchemy, magic, necromancy, and astrology.",
        "OCCULTATION": "The hiding of a heavenly body from sight by the intervention ofsome other of the heavenly bodies; -- applied especially to eclipsesof stars and planets by the moon, and to the eclipses of satellitesof planets by their primaries.",
        "OCCULTED": "Concealed by the intervention of some other heavenly body, as astar by the moon.",
        "OCCULTING": "Same as Occultation.",
        "OCCULTISM": "A certain Oriental system of theosophy. A. P. Sinnett.",
        "OCCULTIST": "An adherent of occultism.",
        "OCCULTLY": "In an occult manner.",
        "OCCULTNESS": "State or quality of being occult.",
        "OCCUPANCY": "The act of taking or holding possession; possession;occupation. Title by occupancy (Law), a right of property acquired bytaking the first possession of a thing, or possession of a thingwhich belonged to nobody, and appropriating it. Blackstone. Kent.",
        "OCCUPATE": "To occupy. [Obs.] Bacon.",
        "OCCURRENT": "Occurring or happening; hence, incidental; accidental.",
        "OCCURSE": "Same as Occursion. [Obs.] Bentley.",
        "OCCURSION": "A meeting; a clash; a collision. [Obs.] Boyle.",
        "OCEAN": "Of or pertaining to the main or great sea; as, the ocean waves;an ocean stream. Milton.",
        "OCEANOGRAPHY": "A description of the ocean.",
        "OCEANOLOGY": "That branch of science which relates to the ocean.",
        "OCEANUS": "The god of the great outer sea, or the river which was believedto flow around the whole earth.",
        "OCELLARY": "Of or pertaining to ocelli.",
        "OCELLATE": "Same as Ocellated.",
        "OCELOID": "Resembling the ocelot.",
        "OCELOT": "An American feline carnivore (Felis pardalis). It ranges fromthe Southwestern United States to Patagonia. It is covered withblackish ocellated spots and blotches, which are variously arranged.The ground color varies from reddish gray to tawny yellow.",
        "OCHERY": "Ocherous. [Written also ochrey, ochry.]",
        "OCHIMY": "See Occamy.",
        "OCHLESIS": "A general morbid condition induced by the crowding together ofmany persons, esp. sick persons, under one roof. G. Gregory.",
        "OCHLOCRACY": "A form of government by the multitude; a mobocracy. Hare.",
        "OCHRACEOUS": "Ocherous.",
        "OCHRE": "See Ocher.",
        "OCHREA": "A greave or legging.",
        "OCHREOUS": "See Ocherous.",
        "OCHREY": "See Ochery.",
        "OCHROLEUCOUS": "Yellowish white; having a faint tint of dingy yellow. Gray.",
        "OCHRY": "See Ochery.",
        "OCHYMY": "See Occamy.",
