        "OCTAEDRAL": "See Octahedral.",
        "OCTAEMERON": "A fast of eight days before a great festival. Shipley.",
        "OCTAGON": "A plane figure of eight sides and eight angles.",
        "OCTAGONAL": "Having eight sides and eight angles.",
        "OCTAGYNOUS": "Having eight pistils or styles; octogynous.",
        "OCTAHEDRAL": "Having eight faces or sides; of, pertaining to, or formed in,octahedrons; as, octahedral cleavage. Octahedral borax (Chem.), boraxobtained from a saturated solution in octahedral crystals, whichcontain five molecules of water of crystallization; distinguishedfrom common or prismatic borax.-- Octahedral iron ore (Min.), magnetite.",
        "OCTAHEDRITE": "Titanium dioxide occurring in acute octahedral crystals.",
        "OCTAHEDRON": "A solid bounded by eight faces. The regular octahedron iscontained by eight equal equilateral triangles.",
        "OCTAMEROUS": "Having the parts in eights; as, an octamerous flower;octamerous mesenteries in polyps.",
        "OCTAMETER": "A verse containing eight feet; as, --Deep'' in|to'' the | dark''ness | peer''ing, | long'' I | stood''there | wond'''ring, | fear''ing. Poe.",
        "OCTANDER": "One of the Octandria.",
        "OCTANDRIA": "A Linnæan class of plants, in which the flowers have eightstamens not united to one another or to the pistil.",
        "OCTANE": "Any one of a group of metametric hydrocarcons (C8H18) of themethane series. The most important is a colorless, volatile,inflammable liquid, found in petroleum, and a constituent of benzeneor ligroin.",
        "OCTANGULAR": "Having eight angles; eight-angled.-- Oc*tan\"gu*lar*ness, n.",
