        "OCTATEUCH": "A collection of eight books; especially, the first eight booksof the Old Testament. [R.]",
        "OCTAVALENT": "Having a valence of eight; capable of being combined with,exchanged for, or compared with, eight atoms of hydrogen; -- said ofcertain atoms or radicals.",
        "OCTAVE": "The first two stanzas of a sonnet, consisting of four verseseach; a stanza of eight lines.With mournful melody it continued this octave. Sir P. Sidney.Double octave. (Mus.) See under Double.-- Octave flute (Mus.), a small flute, the tones of which range anoctave higher than those of the German or ordinary flute; -- calledalso piccolo. See Piccolo.",
        "OCTAVO": "A book composed of sheets each of which is folded into eightleaves; hence, indicating more or less definitely a size of book somade; -- usually written 8vo or 8º.",
        "OCTENE": "Same as Octylene.",
        "OCTENNIAL": "Happening every eighth year; also, lasting a period of eightyears. Johnson.-- Oc*ten\"ni*al*ly, adv.",
        "OCTET": "A composition for eight parts, usually for eight soloinstruments or voices.",
        "OCTIC": "Of the eighth degree or order.-- n. (Alg.)",
        "OCTILE": "Same as Octant, 2. [R.]",
        "OCTILLION": "According to the French method of numeration (which method isfollowed also in the United States) the number expressed by a unitwith twenty-seven ciphers annexed. According to the English method,the number expressed by a unit with forty-eight ciphers annexed. SeeNumeration.",
        "OCTOATE": "A salt of an octoic acid; a caprylate.",
        "OCTOCERA": "Octocerata.",
        "OCTOCERATA": "A suborder of Cephalopoda including Octopus, Argonauta, andallied genera, having eight arms around the head; -- called alsoOctopoda.",
        "OCTOCHORD": "See Octachord.",
        "OCTODECIMO": "Having eighteen leaves to a sheet; as, an octodecimo form,book, leaf, size, etc.",
        "OCTODENTATE": "Having eight teeth.",
        "OCTODONT": "Of or pertaining to the Octodontidæ, a family of rodents whichincludes the coypu, and many other South American species.",
        "OCTOEDRICAL": "See Octahedral. [Obs.] Sir T. Browne.",
        "OCTOFID": "Cleft or separated into eight segments, as a calyx.",
        "OCTOGAMY": "A marrying eight times. [R.] Chaucer.",
