        "OCTOGILD": "A pecuniary compensation for an injury, of eight times thevalue of the thing.",
        "OCTOGONAL": "See Octagonal. [Obs.]",
        "OCTOGYNIA": "A Linnaean order of plants having eight pistils.",
        "OCTOIC": "Pertaining to, derived from, or resembling, octane; -- usedspecifically, to designate any one of a group of acids, the mostimportant of which is called caprylic acid.",
        "OCTOLOCULAR": "Having eight cells for seeds.",
        "OCTONAPHTHENE": "A colorless liquid hydrocarbon of the octylene series,occurring in Caucasian petroleum.",
        "OCTONARY": "Of or pertaining to the number eight. Dr. H. More.",
        "OCTONOCULAR": "Having eight eyes. Derham.",
        "OCTOPEDE": "An animal having eight feet, as a spider.",
        "OCTOPETALOUS": "Having eight petals or flower leaves.",
        "OCTOPOD": "One of the Octocerata.",
        "OCTOPODIA": "Same as Octocerata.",
        "OCTOPUS": "A genus of eight-armed cephalopods, including numerous species,some of them of large size. See Devilfish,",
        "OCTORADIATED": "Having eight rays.",
        "OCTOROON": "The offspring of a quadroon and a white person; a mestee.",
        "OCTOSPERMOUS": "Containing eight seeds.",
        "OCTOSTICHOUS": "In eight vertical ranks, as leaves on a stem.",
        "OCTOSTYLE": "Having eight columns in the front; -- said of a temple orportico. The Parthenon is octostyle, but most large Greek temples arehexastele. See Hexastyle.-- n.",
        "OCTOSYLLABLE": "Octosyllabic.",
        "OCTOYL": "A hypothetical radical (C8H15O), regarded as the essentialresidue of octoic acid.",
        "OCTUOR": "See Octet. [R.]",
        "OCTUPLE": "Eightfold.",
        "OCTYL": "A hypothetical hydrocarbon radical regarded as an essentialresidue of octane, and as entering into its derivatives; as, octylalcohol.",
        "OCTYLENE": "Any one of a series of metameric hydrocarbons (C8H16) of theethylene series. In general they are combustible, colorless liquids.",
        "OCTYLIC": "Pertaining to, derived from, or containing, octyl; as, octylicether.",
        "OCULAR": "Of or pertaining to the eye; optic.",
        "OCULARLY": "By the eye, or by actual sight.",
        "OCULARY": "Of or pertaining to the eye; ocular; optic; as, ocularymedicines. Holland.",
        "OCULIFORM": "In the form of an eye; resembling an eye; as, an oculiformpebble.",
        "OCULINA": "A genus of tropical corals, usually branched, and having a veryvolid texture.",
        "OCULINACEA": "A suborder of corals including many reef-building species,having round, starlike calicles.",
        "OCULIST": "One skilled in treating diseases of the eye.",
        "OCULO-": "A combining form from L. oculus the eye.",
        "OCULOMOTOR": "Of or pertaining to the movement of the eye; -- appliedespecially to the common motor nerves (or third pair of cranialnerves) which supply many of the muscles of the orbit.-- n.",
        "OCULONASAL": "Of or pertaining to the region of the eye and the nose; as, theoculonasal, or nasal, nerve, one of the branches of the ophthalmic.",
        "OCULUS": "A round window, usually a small one.",
        "OCYPODIAN": "One of a tribe of crabs which live in holes in the sand alongthe seashore, and run very rapidly, -- whence the name.",
        "OD": "An alleged force or natural power, supposed, by Reichenbach andothers, to produce the phenomena of mesmerism, and to be developed byvarious agencies, as by magnets, heat, light, chemical or vitalaction, etc.; -- called also odyle or the odylic force. [Archaic]That od force of German Reichenbach Which still, from female fingertips, burnt blue. Mrs. Browning.",
        "ODAL": "Among the early and medieval Teutonic peoples, esp.Scandinavians, the heritable land held by the various odalmenconstituting a family or kindred of freeborn tribesmen; also, theownership of such land. The odal was subject only to certain rightsof the family or kindred in restricting the freedom of transfer orsale and giving certain rights of redemption in case of change ofownership by inheritance, etc., and perhaps to other rights of thekindred or the tribe. Survivals of the early odal estates and tenureexist in Orkney and Shetland, where it is usually called by thevariant form udal.",
        "ODALISQUE": "A female slave or concubine in the harem of the Turkish sultan.[Written also odahlic, odalisk, and odalik.]Not of those that men desire, sleek Odalisques, or oracles of mode.Tennyson.",
        "ODD FELLOW": "A member of a secret order, or fraternity, styled theIndependent Order of Odd Fellows, established for mutual aid andsocial enjoyment.",
        "ODDLY": "In a manner measured by an odd number.",
        "ODDMENT": "An odd thing, or one that is left over, disconnected,fragmentary, or the like; something that is separated or disconnectedfrom its fellows; esp. (in pl.),",
        "ODE": "A short poetical composition proper to be set to music or sung;a lyric poem; esp., now, a poem characterized by sustained noblesentiment and appropriate dignity of style.Hangs odes upon hawthorns and elegies on brambles. Shak.O! run; prevent them with thy humble ode, And lay it lowly at hisblessed feet. Milton.Ode factor, one who makes, or who traffics in, odes; -- usedcontemptuously.",
        "ODELET": "A little or short ode.",
        "ODELSTHING": "The lower house of the Norwegian Storthing. See Legislature.",
        "ODEON": "A kind of theater in ancient Greece, smaller than the dramatictheater and roofed over, in which poets and musicians submitted theirworks to the approval of the public, and contended for prizes; --hence, in modern usage, the name of a hall for musical or dramaticperformances.",
        "ODEUM": "See Odeon.",
        "ODIBLE": "Fitted to excite hatred; hateful. [Obs.] Bale.",
        "ODIC": "Of or pertaining to od. See Od. [Archaic] -- Od\"ic*al*ly, adv.",
        "ODIN": "The supreme deity of the Scandinavians; -- the same as Woden,of the German tribes.There in the Temple, carved in wood, The image of great Odin stood.Longfellow.",
        "ODINIC": "Of or pertaining to Odin.",
        "ODINISM": "Worship of Odin; broadly, the Teutonic heathenism. --O\"din*ist, n.",
        "ODIST": "A writer of an ode or odes.",
        "ODIZE": "To charge with od. See Od. [Archaic]",
        "ODMYL": "A volatile liquid obtained by boiling sulphur with linseed oil.It has an unpleasant garlic odor.",
        "ODOMETER": "An instrument attached to the wheel of a vehicle, to measurethe distance traversed; also, a wheel used by surveyors, whichregisters the miles and rods traversed.",
        "ODOMETRICAL": "Of or pertaining to the odometer, or to measurements made withit.",
        "ODOMETROUS": "Serving to measure distance on a road. [R.] Sydney Smith.",
        "ODOMETRY": "Measurement of distances by the odometer.",
        "ODONATA": "The division of insects that includes the dragon flies.",
        "ODONTALGIA": "Toothache.",
        "ODONTALGIC": "Of or pertaining to odontalgia.-- n.",
        "ODONTALGY": "Same as Odontalgia.",
        "ODONTIASIS": "Cutting of the teeth; dentition.",
        "ODONTO-": "A combining form from Gr.",
        "ODONTOBLAST": "One of the more or less columnar cells on the outer surface ofthe pulp of a tooth; an odontoplast. They are supposed to beconnected with the formation of dentine.",
        "ODONTOCETE": "A subdivision of Cetacea, including the sperm whale, dolphins,etc.; the toothed whales.",
        "ODONTOGENY": "Generetion, or mode of development, of the teeth.",
        "ODONTOGRAPH": "An instrument for marking or laying off the outlines of teethof gear wheels.",
        "ODONTOGRAPHIC": "Of or pertaining to odontography.",
        "ODONTOGRAPHY": "A description of the teeth.",
        "ODONTOLCAE": "An extinct order of ostrichlike aquatic birds having teeth,which are set in a groove in the jaw. It includes Hesperornis, andallied genera. See Hesperornis. [Written also Odontholcae, andOdontoholcae.]",
        "ODONTOLITE": "A fossil tooth colored a bright blue by phosphate of iron. Itis used as an imitation of turquoise, and hence called boneturquoise.",
        "ODONTOLOGY": "The science which treats of the teeth, their structure anddevelopment.",
        "ODONTOPHORA": "Same as Cephalophora.",
        "ODONTOPHORE": "A special structure found in the mouth of most mollusks, exceptbivalves. It consists of several muscles and a cartilage whichsupports a chitinous radula, or lingual ribbon, armed with teeth.Also applied to the radula alone. See Radula.",
        "ODONTOPHOROUS": "Having an odontophore.",
        "ODONTOPLAST": "An odontoblast.",
        "ODONTOPTERYX": "An extinct Eocene bird having the jaws strongly serrated, ordentated, but destitute of true teeth. It was found near London.",
        "ODONTORNITHES": "A group of Mesozoic birds having the jaws armed with teeth, asin most other vertebrates. They have been divided into three orders:Odontolcæ, Odontotormæ, and Saururæ.",
        "ODONTOSTOMATOUS": "Having toothlike mandibles; -- applied to certain insects.",
        "ODONTOTORMAE": "An order of extinct toothed birds having the teeth in sockets,as in the genus Ichthyornis. See Ichthyornis.",
        "ODOR": "Any smell, whether fragrant or offensive; scent; perfume.Meseemed I smelt a garden of sweet flowers, That dainty odors fromthem threw around. Spenser.To be in bad odor, to be out of favor, or in bad repute.",
        "ODORAMENT": "A perfume; a strong scent. [Obs.] Burton.",
        "ODORANT": "Yielding odors; fragrant. Holland.",
        "ODORATE": "Odorous. [Obos.] Bacon.",
        "ODORATING": "Diffusing odor or scent; fragrant.",
        "ODORIFEROUS": "Bearing or yielding an odor; perfumed; usually, sweet of scent;fragrant; as, odoriferous spices, particles, fumes, breezes. Milton.-- O`dor*if\"er*ous*ly, adv. --O`dor*if\"er*ous*ness, n.",
        "ODORINE": "A pungent oily substance obtained by redistilling bone oil.[Obs.]",
        "ODORLESS": "Free from odor.",
        "ODOROUS": "Having or emitting an odor or scent, esp. a sweet odor;fragrant; sweet-smelling. \"Odorous bloom.\" Keble.Such fragrant flowers do give most odorous smell. Spenser.-- O\"dor*ous*ly, adv.-- O\"dor*ous*ness, n.",
        "ODS": "A corruption of God's; -- formerly used in oaths andejaculatory phrases. \"Ods bodikin.\" \"Ods pity.\" Shak.",
        "ODYLIC": "Of or pertaining to odyle; odic; as, odylic force. [Archaic]",
        "ODYSSEY": "An epic poem attributed to Homer, which describes the return ofUlysses to Ithaca after the siege of Troy.",
        "OE": "a diphthong, employed in the Latin language, and thence in theEnglish language, as the representative of the Greek diphthong oe. Inmany words in common use, e alone stands instead of oe. Classicistsprefer to write the diphthong oe separate in Latin words.",
        "OECOID": "The colorless porous framework, or stroma, of red bloodcorpuscles from which the zooid, or hemoglobin and other substancesof the corpuscles, may be dissolved out.",
        "OECOLOGY": "The various relations of animals and plants to one another andto the outer world.",
        "OECONOMICAL": "See Economical.",
        "OECONOMICS": "See Economics.",
        "OECONOMY": "See Economy.",
        "OECUMENICAL": "See Ecumenical.",
        "OEDEMA": "A swelling from effusion of watery fluid in the cellular tissuebeneath the skin or mucous membrance; dropsy of the subcutaneouscellular tissue. [Written also edema.]",
        "OEDEMATOUS": "Pertaining to, or of the nature of, edema; affected with edema.",
        "OEIL-DE-BOEUF": "A circular or oval window; -- generally used of architecture ofthe 17th and 18th centuries. A famous room in the palace ofVersailles bears this name, from the oval window opening into it.",
        "OEIL-DE-PERDRIX": "A glance of the eye; an amorous look. [Obs.]She gave strange oeillades and most speaking looks. Shak.",
        "OELET": "An eye, bud, or shoot, as of a plant; an oilet. [Obs.] Holland.",
        "OENANTHATE": "A salt of the supposed oenanthic acid.",
        "OENANTHIC": "Having, or imparting, the odor characteristic of the bouquet ofwine; specifically used, formerly, to designate an acid whoseethereal salts were supposed to occasion the peculiar bouquet, oraroma, of old wine. Cf. OEnanthylic. OEnanthic acid, an acid obtainedfrom oenanthic ether by the action of alkalies.-- OEnanthic ether, an ethereal substance (not to be confused withthe bouquet, or aroma, of wine) found in wine lees, and consisting ofa complex mixture of the ethereal salts of several of the higheracids of the acetic acid series. It has an ethereal odor, and it usedin flavoring artificial wines and liquors. Called also oil of wine.See Essential oil, under Essential.",
        "OENANTHOL": "An oily substance obtained by the distillation of castor oil,recognized as the aldehyde of oenanthylic acid, and hence called alsooenanthaldehyde.",
        "OENANTHONE": "The ketone of oenanthic acid.",
        "OENANTHYL": "A hydrocarbon radical formerly supposed to exist in oenanthicacid, now known to be identical with heptyl.",
        "OENANTHYLATE": "A salt of oenanthylic acid; as, potassium oenanthylate.",
        "OENANTHYLIC": "Pertaining to, derived from, or containing, oenanthyl;specifically, designating an acid formerly supposed to be identicalwith the acid in oenanthic ether, but now known to be identical withheptoic acid.",
        "OENANTHYLIDENE": "A colorless liquid hydrocarbon, having a garlic odor; heptine.",
        "OENANTHYLOUS": "Of, pertaining to, or designating, an acid formerly supposed tobe the acid of oenanthylic ether, but now known to be a mixture ofhigher acids, especially capric acid. [Obs.]",
        "OENOCYAN": "The coloring matter of red wines.",
        "OENOLOGY": "Knowledge of wine, scientific or practical.",
        "OENOMEL": "Wine mixed with honey; mead, [R.]",
        "OENOMETER": "See Alcoholometer.",
        "OENOPHILIST": "A lover of wine. [R.] Thackeray.",
        "OENOTHIONIC": "Pertaining to an acid now called sulphovinic, or ethylsulphuric, acid.",
        "OERSTED": "The C.G.S. unit of magnetic reluctance or resistance, equal tothe reluctance of a centimeter cube of air (or vacuum) betweenparallel faces. Also, a reluctance in which unit magnetomotive forcesets up unit flux.",
        "OESTRIAN": "Of or pertaining to the gadflies.-- n.",
        "OESTRUAL": "Of or pertaining to sexual desire; -- mostly applied to bruteanimals; as, the oestrual period; oestrual influence.",
        "OESTRUATION": "The state of being under oestrual influence, or of havingsexual desire.",
