        "OFFCUT": "A portion ofthe printed sheet, in certain sizes of books, thatis cut off before folding.",
        "OFFENCE": "See Offense.",
        "OFFEND": "To oppose or obstruct in duty; to cause to stumble; to cause tosin or to fall. [Obs.]Who hath you misboden or offended. Chaucer.If thy right eye offend thee, pluck it out... And if thy right handoffend thee, cut it off. Matt. v. 29, 3O.Great peace have they which love thy law, and nothing shall offendthem. Ps. cxix. 165.",
        "OFFENDANT": "An offender. [R.] Holland.",
        "OFFENDER": "One who offends; one who violates any law, divine or human; awrongdoer.I and my son Solomon shall be counted offenders. 1 Kings i. 21.",
        "OFFENDRESS": "A woman who offends. Shak.",
        "OFFENSEFUL": "Causing offense; displeasing; wrong; as, an offenseful act.[R.]",
        "OFFENSELESS": "Unoffending; inoffensive.",
        "OFFENSIBLE": "That may give offense. [Obs.]",
        "OFFENSION": "Assault; attack. [Obs.] Chaucer.",
        "OFFENSIVE": "The state or posture of one who offends or makes attack;aggressive attitude; the act of the attacking party; -- opposed todefensive. To act on the offensive, to be the attacking party.",
        "OFFERABLE": "Capable of being offered; suitable or worthy to be offered.",
        "OFFERER": "One who offers; esp., one who offers something to God inworship. Hooker.",
        "OFFERTURE": "Offer; proposal; overture. [Obs.]More offertures and advantages to his crown. Milton.",
