        "OFFICEHOLDER": "An officer, particularly one in the civil service; a placeman.",
        "OFFICER": "Specifically, a commissioned officer, in distinction from awarrant officer. Field officer, General officer, etc. See underField, General. etc.-- Officer of the day (Mil.), the officer who, on a given day, hascharge for that day of the quard, prisoners, and police of the postor camp.-- Officer of the deck, or Officer of the watch (Naut.), the officertemporarily in charge on the deck of a vessel, esp. a war vessel.",
        "OFFICIAL": "Approved by authority; sanctioned by the pharmacopoeia;appointed to be used in medicine; as, an official drug orpreparation. Cf. Officinal.",
        "OFFICIALISM": "The state of being official; a system of official government;also, adherence to office routine; red-tapism.Officialism may often drift into blunders. Smiles.",
        "OFFICIALITY": "See Officialty.",
        "OFFICIALLY": "By the proper officer; by virtue of the proper authority; inpursuance of the special powers vested in an officer or office; as,accounts or reports officially vertified or rendered; lettersofficially communicated; persons officially notified.",
        "OFFICIALTY": "The charge, office, court, or jurisdiction of an official.Ayliffe.",
