        "OFFICIARY": "Of or pertaining to an office or an officer; official. [R.]Heylin.",
        "OFFICIATE": "To act as an officer in performing a duty; to transact thebusiness of an office or public trust; to conduct a public service.Bp. Stillingfleet.",
        "OFFICIATOR": "One who officiates. Tylor.",
        "OFFICINAL": "Kept in stock by apothecaries; -- said of such drugs andmedicines as may be obtained without special preparation orcompounding; not magistral.",
        "OFFING": "That part of the sea at a good distance from the shore, orwhere there is deep water and no need of a pilot; also, distance fromthe shore; as, the ship had ten miles offing; we saw a ship in theoffing.",
