        "OLOGY": "A colloquial or humorous name for any science or branch ofknowledge.He had a smattering of mechanics, of physiology, geology, mineralogy,and all other ologies whatsoever. De Quincey.",
        "OLPE": "Originally, a leather flask or vessel for oils or liquids;afterward, an earthenware vase or pitcher without a spout.",
        "OLUSATRUM": "An umbelliferous plant, the common Alexanders of Western Europe(Smyrnium Olusatrum).",
        "OLYMPIAD": "A period of four years, by which the ancient Greeks reckonedtime, being the interval from one celebration of the Olympic games toanother, beginning with the victory of Coroebus in the foot race,which took place in the year 776 b.c.; as, the era of the olympiads.",
        "OLYMPIANISM": "Worship of the Olympian gods, esp. as a dominant cult orreligion.",
        "OLYMPIONIC": "An ode in honor of a victor in the Olympic games. [R.] Johnson.",
        "OM": "A mystic syllable or ejaculation used by Hindus and Buddhistsin religious rites, -- orig. among the Hindus an exclamation ofassent, like Amen, then an invocation, and later a symbol of thetrinity formed by Vishnu, Siva, and Brahma. -- Om mani padme hun, asacred formula of buddhism (esp. of the Lamaists) translated \"O, theJewel in the Lotus, Amen,\" and referring to Amitabha, who is commonlyrepresented as standing or sitting within a lotus.",
        "OMAGRA": "Gout in the shoulder.",
        "OMAHAS": "A tribe of Indians who inhabited the south side of the MissouriRiver. They are now partly civilized and occupy a reservation inNebraska.",
