        "OMICRON": "Lit., the little, or short, O, o; the fifteenth letter of theGreek alphabet.",
        "OMILETICAL": "Homiletical. [Obs.]",
        "OMINATE": "To presage; to foreshow; to foretoken. [Obs.] Dr. H. More.",
        "OMINATION": "The act of ominating; presaging. [Obs.] Fuller.",
        "OMINOUS": "Of or pertaining to an omen or to omens; being or exhibiting anomen; significant; portentous; -- formerly used both in a favorableand unfavorable sense; now chiefly in the latter; foreboding orforeshowing evil; inauspicious; as, an ominous dread.He had a good ominous name to have made a peace. Bacon.In the heathen worship of God, a sacrifice without a heart wasaccounted ominous. South.-- Om\"i*nous*ly, adv.-- Om\"i*nous*ness, n.",
        "OMISSIBLE": "Capable of being omitted; that may be omitted.",
        "OMISSIVE": "Leaving out; omitting. Bp. Hall.-- O*mis\"sive*ly, adv.",
        "OMITTANCE": "The act of omitting, or the state of being omitted;forbearance; neglect. Shak.",
        "OMITTER": "One who omits. Fuller.",
        "OMMATEAL": "Of or pertaining to an ommateum.",
        "OMMATEUM": "A compound eye, as of insects and crustaceans.",
        "OMMATIDIUM": "One of the single eyes forming the compound eyes ofcrustaceans, insects, and other invertebrates.",
        "OMNI-": "A combining form denoting all, every, everywhere; as inomnipotent, all-powerful; omnipresent.",
        "OMNIBUS": "A sheet-iron cover for articles in a leer or annealing arch, toprotect them from drafts. Omnibus bill, a legislative bill whichprovides for a number of miscellaneous enactments or appropriations.[Parliamentary Cant, U.S.] -- Omnibus box, a large box in a theater,on a level with the stage and having communication with it. [Eng.]Thackeray.",
        "OMNICORPOREAL": "Comprehending or including all bodies; embracing all substance.[R.] Cudworth.",
        "OMNIETY": "That which is all-pervading or all-comprehensive; hence, theDeity. [R.]Omniety formed nullity into an essence. Sir T. Browne.",
        "OMNIFARIOUS": "Of all varieties, forms, or kinds. \"Omnifarious learning.\"Coleridge.",
        "OMNIFEROUS": "All-bearing; producing all kinds.",
        "OMNIFIC": "All-creating. \"The omnific word.\" Milton.",
        "OMNIFORM": "Having every form or shape. Berkeley.",
        "OMNIFORMITY": "The condition or quality of having every form. Dr. H. More.",
        "OMNIFY": "To render universal; to enlarge. [R.]Omnify the disputed point into a transcendent, and you may defy theopponent to lay hold of it. Coleridge.",
        "OMNIGENOUS": "Consisting of all kinds. [R.]",
        "OMNIGRAPH": "A pantograph. [R.]",
        "OMNIPARIENT": "Producing or bringing forth all things; all-producing. [R.]",
        "OMNIPARITY": "Equality in every part; general equality.",
        "OMNIPAROUS": "Producing all things; omniparient.",
        "OMNIPATIENT": "Capable of enduring all things. [R.] Carlyle.",
        "OMNIPERCIPIENT": "Perceiving everything. Dr. H. More.",
        "OMNIPOTENTLY": "In an omnipotent manner.",
        "OMNIPRESENCE": "Presence in every place at the same time; unbounded oruniversal presence; ubiquity.His omnipresence fills Land, sea, and air, and every kind that lives.Milton.",
        "OMNIPRESENCY": "Omnipresence. [Obs.]",
        "OMNIPRESENT": "Present in all places at the same time; ubiquitous; as, theomnipresent Jehovah. Prior.",
        "OMNIPRESENTIAL": "Implying universal presence. [R.] South.",
        "OMNIPREVALENT": "Prevalent everywhere or in all things. Fuller.",
        "OMNISCIENCE": "The quality or state of being omniscient; -- an attributepeculiar to God. Dryden.",
        "OMNISCIENCY": "Omniscience.",
        "OMNISCIENT": "Having universal knowledge; knowing all things; infinitelyknowing or wise; as, the omniscient God.-- Om*nis\"cient*ly, adv.For what can scape the eye Of God all-seeing, or deceive his heartOmniscient Milton.",
        "OMNISCIOUS": "All-knowing. [Obs.] Hakewill.",
        "OMNISPECTIVE": "Beholding everything; capable of seeing all things; all-seeing.[R.] \"Omnispective Power!\" Boyse.",
        "OMNIUM": "The aggregate value of the different stocks in which a loan togovernment is now usually funded. M'Culloch.",
